import principalImg from './assets/cellphone.png';
import voxsweetLogo from './assets/Logo.png';
import { Signup } from './components/Signup'


function App() {
  return (
    <div className="container-fluid">
        <div className="principal-img-content">
          <img className="principal-img" src={principalImg} alt=""/>
        </div>

        <div className="principal-content">
          <div className="logo-img">
          <img className="logo-img" src={voxsweetLogo} alt=""/>
          </div>
            <Signup />

      </div>
    </div>
  );
}

export default App;
